window.bookSummaryJSON = "<p>Jonathan Cecil, described as having “one of the best-loved voices in audiobooks” by the P. G. Wodehouse Society, narrates this collection of brilliantly entertaining stories featuring Jeeves and Wooster, including: \"Jeeves and the Impending Doom\", \"Jeeves and the Kid Clementina\", \"The Inferiority Complex of Old Sippy\", \"The Love That Purifies\", \"Jeeves and the Yule-Tide Spirit\", \"Jeeves and the Old School Chum\", \"Jeeves and the Song of Songs\", \"Indian Summer of an Uncle\", \"Episode of the Dog McIntosh\", \"The Ordeal of Young Tuppy\", and \"The Spot of Art.\"</p>"; 
